import React from "react";
import styles from "./SpecialItem.module.scss";

export const SpecialItem = () => {
  return (
    <div className={`${styles.specialItem}`}>
      <div className={styles.imgWrap}>
        <img src={require("./images/specialitem1.png")} alt='' />
      </div>

      <div className={`${styles.bottom}`}>
        <span className={styles.title}>★ Rare special item ★</span>
      </div>
    </div>
  );
};
